import React from "react";

import data from "../Data/data.json";

function Sidebar(){
    return(
        <div>
            {
                data.categories.map(category => {
                    return(
                        <div key={category.id}> {category.name} </div>
                    )
                })
            }
        </div>
    )
};

export default Sidebar;
